import React from "react";
import "./Tabs.css"

type Color = "active" | "default";

type Tabs = {
    text: string,
    TabsType?: Color
}


export default function Tabs(Props: Tabs) {

    const { text, TabsType } = Props;


    return (
        <button className="bgColor" data-buttonType={TabsType}> { text }</button >
    )
}
